import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import './App.css';

// Components
import Home from './components/Home.tsx';
import ZapScanner from './components/tools/ZapScanner.tsx';
import NmapScanner from './components/tools/NmapScanner.tsx';
import WiresharkAnalyzer from './components/tools/WiresharkAnalyzer.tsx';
import JohnTheRipper from './components/tools/JohnTheRipper.tsx';

function App() {
  return (
    <div style={{ minHeight: '100vh', background: '#0f172a', color: '#e2e8f0' }}>
      <nav style={{ background: '#111827', color: '#fff', borderBottom: '1px solid #1f2937' }}>
        <div style={{ maxWidth: 1200, margin: '0 auto', padding: '0 16px' }}>
          <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', height: 64 }}>
            <div style={{ display: 'flex', alignItems: 'center' }}>
              <div style={{ marginRight: 24 }}>
                <h1 style={{ fontSize: 18, fontWeight: 700, margin: 0 }}>LinkLens</h1>
              </div>
              <div>
                <div style={{ display: 'flex', gap: 12 }}>
                  <NavLink to="/">Home</NavLink>
                  <NavLink to="/zap">OWASP ZAP</NavLink>
                  <NavLink to="/nmap">Nmap</NavLink>
                  <NavLink to="/wireshark">Wireshark</NavLink>
                  <NavLink to="/john">John the Ripper</NavLink>
                </div>
              </div>
            </div>
          </div>
        </div>
      </nav>

      <main style={{ maxWidth: 1200, margin: '0 auto', padding: '24px 16px' }}>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/zap" element={<ZapScanner />} />
          <Route path="/nmap" element={<NmapScanner />} />
          <Route path="/wireshark" element={<WiresharkAnalyzer />} />
          <Route path="/john" element={<JohnTheRipper />} />
        </Routes>
      </main>
    </div>
  );
}

// Helper component for navigation links
function NavLink({ to, children }: { to: string; children: React.ReactNode }) {
  return (
    <Link
      to={to}
      style={{
        padding: '8px 12px',
        borderRadius: 6,
        fontSize: 14,
        color: '#e5e7eb',
        textDecoration: 'none',
        background: 'transparent',
      }}
    >
      {children}
    </Link>
  );
}

export default App;
